selector_to_html = {"a[href=\"#static-members-functions\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Static Members Functions<a class=\"headerlink\" href=\"#static-members-functions\" title=\"Permalink to this heading\">#</a></h2><p>Static member functions are called with struct type name, not instance name.</p>", "a[href=\"#adding-arithmetic-functions\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Adding arithmetic functions<a class=\"headerlink\" href=\"#adding-arithmetic-functions\" title=\"Permalink to this heading\">#</a></h2><p>Basic operations such as <code class=\"docutils literal notranslate\"><span class=\"pre\">==</span></code> are not available to a struct by default, so these must all be defined by the user for each new struct.</p>", "a[href=\"#accessing-structs-by-pointer\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Accessing Structs by Pointer<a class=\"headerlink\" href=\"#accessing-structs-by-pointer\" title=\"Permalink to this heading\">#</a></h2><p>Instead of passing by reference, as struct can be accessed by a pointer.</p><p>Structures are often accessed through pointers using the <code class=\"docutils literal notranslate\"><span class=\"pre\">-&gt;</span></code> the struct pointer member dereference operator.</p>", "a[href=\"#exampleY3\"]": "<div class=\"code_example dropdown admonition\" id=\"exampleY3\">\n<p class=\"admonition-title\">Code Example: Struct Example 3 </p>\n<section id=\"code_example-content\">\n<div class=\"cell tag_remove-output tag_skip-execution docutils container\">\n<div class=\"cell_input docutils container\">\n<div class=\"highlight-C++ notranslate\"><div class=\"highlight\"><pre><span></span><span class=\"cp\">#include</span><span class=\"w\"> </span><span class=\"cpf\">&lt;iostream&gt;</span>\n<span class=\"k\">struct</span><span class=\"w\"> </span><span class=\"nc\">RationalNumber</span><span class=\"w\"> </span><span class=\"p\">{</span>\n<span class=\"w\">    </span><span class=\"kt\">int</span><span class=\"w\"> </span><span class=\"n\">numerator</span><span class=\"p\">;</span>\n<span class=\"w\">    </span><span class=\"kt\">int</span><span class=\"w\"> </span><span class=\"n\">denominator</span><span class=\"p\">;</span>\n<span class=\"p\">};</span>\n<span class=\"kt\">int</span><span class=\"w\"> </span><span class=\"nf\">main</span><span class=\"p\">()</span><span class=\"w\"> </span><span class=\"p\">{</span>\n<span class=\"w\">    </span><span class=\"n\">RationalNumber</span><span class=\"w\"> </span><span class=\"n\">myRationalNumber</span><span class=\"p\">;</span>\n<span class=\"w\">    </span><span class=\"n\">myRationalNumber</span><span class=\"w\"> </span><span class=\"o\">=</span><span class=\"w\"> </span><span class=\"p\">{</span><span class=\"w\"> </span><span class=\"mi\">3</span><span class=\"p\">,</span><span class=\"w\"> </span><span class=\"mi\">5</span><span class=\"p\">};</span>\n<span class=\"w\">    </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cout</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\"My Rational Number = \"</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"n\">myRationalNumber</span><span class=\"p\">.</span><span class=\"n\">numerator</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\" / \"</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"n\">myRationalNumber</span><span class=\"p\">.</span><span class=\"n\">denominator</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"sc\">'\\n'</span><span class=\"p\">;</span>\n<span class=\"w\">    </span><span class=\"n\">myRationalNumber</span><span class=\"w\"> </span><span class=\"o\">=</span><span class=\"w\"> </span><span class=\"p\">{</span><span class=\"w\"> </span><span class=\"mi\">4</span><span class=\"p\">,</span><span class=\"w\"> </span><span class=\"mi\">7</span><span class=\"w\"> </span><span class=\"p\">};</span>\n<span class=\"w\">    </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cout</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\"My Rational Number = \"</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"n\">myRationalNumber</span><span class=\"p\">.</span><span class=\"n\">numerator</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\" / \"</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"n\">myRationalNumber</span><span class=\"p\">.</span><span class=\"n\">denominator</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"sc\">'\\n'</span><span class=\"p\">;</span>\n<span class=\"w\">    </span><span class=\"k\">return</span><span class=\"w\"> </span><span class=\"mi\">0</span><span class=\"p\">;</span>\n<span class=\"p\">}</span>\n</pre></div>\n</div>\n</div>\n</div>\n<div class=\"code_explanation dropdown admonition\" id=\"explanationY3\">\n<p class=\"admonition-title\">Explanation of  <a class=\"reference internal\" href=\"#exampleY3\"> Code Example: Struct Example 3 </a></p>\n<section id=\"code_explanation-content\">\n<p>Both the list and the .notation may be used to modify existing values.</p>\n</section>\n</div>\n</section>\n</div>", "a[href=\"#creating-and-instantiating-a-struct\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Creating and Instantiating a Struct<a class=\"headerlink\" href=\"#creating-and-instantiating-a-struct\" title=\"Permalink to this heading\">#</a></h2><p>A struct is declared as follows:</p>", "a[href=\"#exampleY4\"]": "<div class=\"code_example dropdown admonition\" id=\"exampleY4\">\n<p class=\"admonition-title\">Code Example: Struct Example 4 </p>\n<section id=\"code_example-content\">\n<p>Intialisaton by non-member function:</p>\n<div class=\"cell tag_remove-output tag_skip-execution docutils container\">\n<div class=\"cell_input docutils container\">\n<div class=\"highlight-C++ notranslate\"><div class=\"highlight\"><pre><span></span><span class=\"cp\">#include</span><span class=\"w\"> </span><span class=\"cpf\">&lt;iostream&gt;</span>\n<span class=\"kt\">void</span><span class=\"w\"> </span><span class=\"nf\">init_RationalNumber</span><span class=\"p\">(</span><span class=\"n\">RationalNumber</span><span class=\"o\">&amp;</span><span class=\"w\"> </span><span class=\"n\">rationalNumber</span><span class=\"p\">,</span><span class=\"w\"> </span><span class=\"kt\">int</span><span class=\"w\"> </span><span class=\"n\">numerator</span><span class=\"p\">,</span><span class=\"w\"> </span><span class=\"kt\">int</span><span class=\"w\"> </span><span class=\"n\">denominator</span><span class=\"p\">)</span><span class=\"w\"> </span><span class=\"p\">{</span>\n<span class=\"w\">    </span><span class=\"k\">if</span><span class=\"w\"> </span><span class=\"p\">(</span><span class=\"n\">denominator</span><span class=\"w\"> </span><span class=\"o\">!=</span><span class=\"w\"> </span><span class=\"mi\">0</span><span class=\"p\">)</span><span class=\"w\"> </span><span class=\"n\">rationalNumber</span><span class=\"w\"> </span><span class=\"o\">=</span><span class=\"w\"> </span><span class=\"p\">{</span><span class=\"w\"> </span><span class=\"n\">numerator</span><span class=\"p\">,</span><span class=\"w\"> </span><span class=\"n\">denominator</span><span class=\"w\"> </span><span class=\"p\">};</span>\n<span class=\"w\">    </span><span class=\"k\">else</span><span class=\"w\"> </span><span class=\"k\">throw</span><span class=\"w\"> </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">invalid_argument</span><span class=\"p\">(</span><span class=\"s\">\"Denominator cannot be zero.\"</span><span class=\"p\">);</span>\n<span class=\"p\">}</span>\n\n<span class=\"kt\">int</span><span class=\"w\"> </span><span class=\"nf\">main</span><span class=\"p\">()</span><span class=\"w\"> </span><span class=\"p\">{</span>\n<span class=\"w\">    </span><span class=\"n\">RationalNumber</span><span class=\"w\"> </span><span class=\"n\">myRationalNumber</span><span class=\"p\">;</span>\n<span class=\"w\">    </span><span class=\"n\">init_RationalNumber</span><span class=\"p\">(</span><span class=\"n\">myRationalNumber</span><span class=\"p\">,</span><span class=\"w\"> </span><span class=\"mi\">3</span><span class=\"p\">,</span><span class=\"w\"> </span><span class=\"mi\">5</span><span class=\"p\">);</span>\n<span class=\"w\">    </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cout</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\"My Rational Number = \"</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"n\">myRationalNumber</span><span class=\"p\">.</span><span class=\"n\">numerator</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\" / \"</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"n\">myRationalNumber</span><span class=\"p\">.</span><span class=\"n\">denominator</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"sc\">'\\n'</span><span class=\"p\">;</span>\n<span class=\"w\">    </span><span class=\"k\">return</span><span class=\"w\"> </span><span class=\"mi\">0</span><span class=\"p\">;</span>\n<span class=\"p\">}</span>\n</pre></div>\n</div>\n</div>\n</div>\n<div class=\"code_explanation dropdown admonition\" id=\"explanationY4\">\n<p class=\"admonition-title\">Explanation of  <a class=\"reference internal\" href=\"#exampleY4\"> Code Example: Struct Example 4 </a></p>\n<section id=\"code_explanation-content\">\n</section>\n</div>\n<p>This initialisation function passes a reference to the rational number.</p>\n<p>Note that a referenced object is not a copy and can therefore be modified.</p>\n<p>But there is not yet any explicit connection between the functions and the struct; it is usually better to use a member function.</p>\n<p>This is not generally how structs are initialised.</p>\n</section>\n</div>", "a[href=\"#initialising-the-data-held-by-an-instance\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Initialising the Data held by an Instance<a class=\"headerlink\" href=\"#initialising-the-data-held-by-an-instance\" title=\"Permalink to this heading\">#</a></h2><p>The members of a struct are held in the order of declaration, so list initialisation is possible.</p><p>Values of a struct may also be initialised using an initialiser list <code class=\"docutils literal notranslate\"><span class=\"pre\">{}</span></code> - do keep the order of parameters the same as the listing.</p>", "a[href=\"#constructors\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Constructors<a class=\"headerlink\" href=\"#constructors\" title=\"Permalink to this heading\">#</a></h2><p>The best method is initialisation it to use a constructor.</p><p>A constructor is a member function that specifically initialises an instance of a struct or class.</p>", "a[href=\"#structs\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Structs<a class=\"headerlink\" href=\"#structs\" title=\"Permalink to this heading\">#</a></h1><p>Structs are user defined types, and a subset of classes.</p><p>Structs are useful for gathering related variables together into a sequence of arbitrary types called the members of the struct.</p>", "a[href=\"#exampleY1\"]": "<div class=\"code_example dropdown admonition\" id=\"exampleY1\">\n<p class=\"admonition-title\">Code Example: Struct Example 1 </p>\n<section id=\"code_example-content\">\n<p>Example of a simple struct - RationalNumber.</p>\n<div class=\"cell tag_remove-output tag_skip-execution docutils container\">\n<div class=\"cell_input docutils container\">\n<div class=\"highlight-C++ notranslate\"><div class=\"highlight\"><pre><span></span><span class=\"cp\">#include</span><span class=\"w\"> </span><span class=\"cpf\">&lt;iostream&gt;</span>\n<span class=\"k\">struct</span><span class=\"w\"> </span><span class=\"nc\">RationalNumber</span><span class=\"w\"> </span><span class=\"p\">{</span>\n<span class=\"w\">    </span><span class=\"kt\">int</span><span class=\"w\"> </span><span class=\"n\">numerator</span><span class=\"p\">;</span>\n<span class=\"w\">    </span><span class=\"kt\">int</span><span class=\"w\"> </span><span class=\"n\">denominator</span><span class=\"p\">;</span>\n<span class=\"p\">};</span>\n<span class=\"kt\">int</span><span class=\"w\"> </span><span class=\"nf\">main</span><span class=\"p\">()</span><span class=\"w\"> </span><span class=\"p\">{</span>\n<span class=\"w\">        </span><span class=\"n\">RationalNumber</span><span class=\"w\"> </span><span class=\"n\">myRationalNumber</span><span class=\"p\">;</span>\n<span class=\"w\">        </span><span class=\"n\">myRationalNumber</span><span class=\"p\">.</span><span class=\"n\">numerator</span><span class=\"w\"> </span><span class=\"o\">=</span><span class=\"w\"> </span><span class=\"mi\">3</span><span class=\"p\">;</span>\n<span class=\"w\">        </span><span class=\"n\">myRationalNumber</span><span class=\"p\">.</span><span class=\"n\">denominator</span><span class=\"w\"> </span><span class=\"o\">=</span><span class=\"w\"> </span><span class=\"mi\">5</span><span class=\"p\">;</span>\n<span class=\"w\">        </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cout</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\"My Rational Number = \"</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"n\">myRationalNumber</span><span class=\"p\">.</span><span class=\"n\">numerator</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\" / \"</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"n\">myRationalNumber</span><span class=\"p\">.</span><span class=\"n\">denominator</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"sc\">'\\n'</span><span class=\"p\">;</span>\n<span class=\"w\">        </span><span class=\"k\">return</span><span class=\"w\"> </span><span class=\"mi\">0</span><span class=\"p\">;</span>\n<span class=\"p\">}</span>\n</pre></div>\n</div>\n</div>\n</div>\n<div class=\"code_explanation dropdown admonition\" id=\"explanationY1\">\n<p class=\"admonition-title\">Explanation of  <a class=\"reference internal\" href=\"#exampleY1\"> Code Example: Struct Example 1 </a></p>\n<section id=\"code_explanation-content\">\n<p>Values can be set manually after the creation of an instance of the struct, because the data members are publicly accessible by default.</p>\n</section>\n</div>\n</section>\n</div>", "a[href=\"#initialisation-by-function\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Initialisation by Function<a class=\"headerlink\" href=\"#initialisation-by-function\" title=\"Permalink to this heading\">#</a></h2><p>We can create a non-member function to initialise a copy of the struct and to check for invalid entries etc.</p>", "a[href=\"#technical-details\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Technical Details<a class=\"headerlink\" href=\"#technical-details\" title=\"Permalink to this heading\">#</a></h2><p>A struct is a simple class whose members are public by default; a class has private members.</p><p>The name of the struct can be used within its own declaration i.e. the name is available after it has been seen by the compiler, not after the declaration has been completed as with most declarations.</p>", "a[href=\"#exampleY5\"]": "<div class=\"code_example dropdown admonition\" id=\"exampleY5\">\n<p class=\"admonition-title\">Code Example: Struct Example 5 </p>\n<section id=\"code_example-content\">\n<p>Using a member function for initalisation:</p>\n<div class=\"cell tag_remove-output tag_skip-execution docutils container\">\n<div class=\"cell_input docutils container\">\n<div class=\"highlight-C++ notranslate\"><div class=\"highlight\"><pre><span></span><span class=\"cp\">#include</span><span class=\"w\"> </span><span class=\"cpf\">&lt;iostream&gt;</span>\n<span class=\"k\">struct</span><span class=\"w\"> </span><span class=\"nc\">RationalNumber</span><span class=\"w\"> </span><span class=\"p\">{</span>\n<span class=\"w\">    </span><span class=\"kt\">int</span><span class=\"w\"> </span><span class=\"n\">numerator</span><span class=\"p\">;</span>\n<span class=\"w\">    </span><span class=\"kt\">int</span><span class=\"w\"> </span><span class=\"n\">denominator</span><span class=\"p\">;</span>\n\n<span class=\"w\">    </span><span class=\"kt\">void</span><span class=\"w\"> </span><span class=\"nf\">init_RationalNumber</span><span class=\"p\">(</span><span class=\"n\">RationalNumber</span><span class=\"o\">&amp;</span><span class=\"w\"> </span><span class=\"n\">rationalNumber</span><span class=\"p\">,</span><span class=\"w\"> </span><span class=\"kt\">int</span><span class=\"w\"> </span><span class=\"n\">numerator</span><span class=\"p\">,</span><span class=\"w\"> </span><span class=\"kt\">int</span><span class=\"w\"> </span><span class=\"n\">denominator</span><span class=\"p\">)</span><span class=\"w\"> </span><span class=\"p\">{</span>\n<span class=\"w\">        </span><span class=\"k\">if</span><span class=\"w\"> </span><span class=\"p\">(</span><span class=\"n\">denominator</span><span class=\"w\"> </span><span class=\"o\">!=</span><span class=\"w\"> </span><span class=\"mi\">0</span><span class=\"p\">)</span><span class=\"w\"> </span><span class=\"n\">rationalNumber</span><span class=\"w\"> </span><span class=\"o\">=</span><span class=\"w\"> </span><span class=\"p\">{</span><span class=\"w\"> </span><span class=\"n\">numerator</span><span class=\"p\">,</span><span class=\"w\"> </span><span class=\"n\">denominator</span><span class=\"w\"> </span><span class=\"p\">};</span>\n<span class=\"w\">        </span><span class=\"k\">else</span><span class=\"w\"> </span><span class=\"k\">throw</span><span class=\"w\"> </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">invalid_argument</span><span class=\"p\">(</span><span class=\"s\">\"Denominator cannot be zero.\"</span><span class=\"p\">);</span>\n<span class=\"w\">    </span><span class=\"p\">}</span>\n<span class=\"p\">};</span>\n\n<span class=\"kt\">int</span><span class=\"w\"> </span><span class=\"nf\">main</span><span class=\"p\">()</span><span class=\"w\"> </span><span class=\"p\">{</span>\n<span class=\"w\">    </span><span class=\"n\">RationalNumber</span><span class=\"w\"> </span><span class=\"n\">myRationalNumber</span><span class=\"p\">;</span>\n<span class=\"w\">    </span><span class=\"n\">myRationalNumber</span><span class=\"p\">.</span><span class=\"n\">init_RationalNumber</span><span class=\"p\">(</span><span class=\"n\">myRationalNumber</span><span class=\"p\">,</span><span class=\"w\"> </span><span class=\"mi\">3</span><span class=\"p\">,</span><span class=\"w\"> </span><span class=\"mi\">5</span><span class=\"p\">);</span>\n<span class=\"w\">    </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cout</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\"My Rational Number = \"</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"n\">myRationalNumber</span><span class=\"p\">.</span><span class=\"n\">numerator</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\" / \"</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"n\">myRationalNumber</span><span class=\"p\">.</span><span class=\"n\">denominator</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"sc\">'\\n'</span><span class=\"p\">;</span>\n<span class=\"w\">    </span><span class=\"k\">return</span><span class=\"w\"> </span><span class=\"mi\">0</span><span class=\"p\">;</span>\n<span class=\"p\">}</span>\n</pre></div>\n</div>\n</div>\n</div>\n<div class=\"code_explanation dropdown admonition\" id=\"explanationY5\">\n<p class=\"admonition-title\">Explanation of  <a class=\"reference internal\" href=\"#exampleY5\"> Code Example: Struct Example 5 </a></p>\n<section id=\"code_explanation-content\">\n<p>Now <code class=\"docutils literal notranslate\"><span class=\"pre\">init_</span></code> is a member function and must be called using the <code class=\"docutils literal notranslate\"><span class=\"pre\">.</span></code> notation on an instance.</p>\n<p>Its better to separate the declaration of the struct from the definitions.</p>\n</section>\n</div>\n</section>\n</div>", "a[href=\"#exampleY2\"]": "<div class=\"code_example dropdown admonition\" id=\"exampleY2\">\n<p class=\"admonition-title\">Code Example: Struct Example 2 </p>\n<section id=\"code_example-content\">\n<div class=\"cell tag_remove-output tag_skip-execution docutils container\">\n<div class=\"cell_input docutils container\">\n<div class=\"highlight-C++ notranslate\"><div class=\"highlight\"><pre><span></span><span class=\"cp\">#include</span><span class=\"w\"> </span><span class=\"cpf\">&lt;iostream&gt;</span>\n<span class=\"k\">struct</span><span class=\"w\"> </span><span class=\"nc\">RationalNumber</span><span class=\"w\"> </span><span class=\"p\">{</span>\n<span class=\"w\">    </span><span class=\"kt\">int</span><span class=\"w\"> </span><span class=\"n\">numerator</span><span class=\"p\">;</span>\n<span class=\"w\">    </span><span class=\"kt\">int</span><span class=\"w\"> </span><span class=\"n\">denominator</span><span class=\"p\">;</span>\n<span class=\"p\">};</span>\n<span class=\"kt\">int</span><span class=\"w\"> </span><span class=\"nf\">main</span><span class=\"p\">()</span><span class=\"w\"> </span><span class=\"p\">{</span>\n<span class=\"w\">    </span><span class=\"n\">RationalNumber</span><span class=\"w\"> </span><span class=\"n\">myRationalNumber</span><span class=\"p\">;</span>\n<span class=\"w\">    </span><span class=\"n\">myRationalNumber</span><span class=\"w\"> </span><span class=\"o\">=</span><span class=\"w\"> </span><span class=\"p\">{</span><span class=\"w\"> </span><span class=\"mi\">3</span><span class=\"p\">,</span><span class=\"w\"> </span><span class=\"mi\">5</span><span class=\"p\">};</span>\n<span class=\"w\">    </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cout</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\"My Rational Number = \"</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"n\">myRationalNumber</span><span class=\"p\">.</span><span class=\"n\">numerator</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\" / \"</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"n\">myRationalNumber</span><span class=\"p\">.</span><span class=\"n\">denominator</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"sc\">'\\n'</span><span class=\"p\">;</span>\n<span class=\"w\">    </span><span class=\"k\">return</span><span class=\"w\"> </span><span class=\"mi\">0</span><span class=\"p\">;</span>\n<span class=\"p\">}</span>\n</pre></div>\n</div>\n</div>\n</div>\n<div class=\"code_explanation dropdown admonition\" id=\"explanationY2\">\n<p class=\"admonition-title\">Explanation of  <a class=\"reference internal\" href=\"#exampleY2\"> Code Example: Struct Example 2 </a></p>\n<section id=\"code_explanation-content\">\n<p>Note: <code class=\"docutils literal notranslate\"><span class=\"pre\">size0f()</span></code> does not work the same for stucts, because of memory layout issues with structs that vary between architectures and implementations.</p>\n<p>It is best to order members in a struct in size order i.e. largest member first e.g. <code class=\"docutils literal notranslate\"><span class=\"pre\">double</span></code> then <code class=\"docutils literal notranslate\"><span class=\"pre\">int</span></code> then <code class=\"docutils literal notranslate\"><span class=\"pre\">char</span></code> types etc.</p>\n</section>\n</div>\n</section>\n</div>", "a[href=\"#altering-the-value-of-the-data-members-of-an-instance\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Altering the Value of the Data Members of an Instance<a class=\"headerlink\" href=\"#altering-the-value-of-the-data-members-of-an-instance\" title=\"Permalink to this heading\">#</a></h2>"}
